INSERT INTO xedu_course.course_base (id, name, users, mt, grade, studymodel, teachmode, description, st, status, company_id, user_id) VALUES ('4028e581617f945f01617f9dabc40000', 'Bootstrap开发框架', '', '1-1', '200002', '201001', null, 'Bootstrap是由Twitter推出的一个前台页面开发框架，在行业之中使用较为广泛。此开发框架包含了大量的CSS、JS程序代码，可以帮助开发者（尤其是不擅长页面开发的程序人员）轻松的实现一个不受浏览器限制的精美界面效果。', '1-1-1', '202002', '1', null);
INSERT INTO xedu_course.course_base (id, name, users, mt, grade, studymodel, teachmode, description, st, status, company_id, user_id) VALUES ('4028e58161bcf7f40161bcf8b77c0000', 'spring cloud实战', '所有人', '1-3', '200003', '201001', null, '本课程主要从四个章节进行讲解： 1.微服务架构入门 2.spring cloud 基础入门 3.实战Spring Boot 4.注册中心eureka。', '1-3-2', '202002', '1', null);
INSERT INTO xedu_course.course_base (id, name, users, mt, grade, studymodel, teachmode, description, st, status, company_id, user_id) VALUES ('4028e58161bd22e60161bd23672a0001', 'Javascript之VueJS', '所有人', '1-1', '200002', '201001', null, 'Vue系列课程：从Vue1.0讲到Vue2.0，从理论讲到实战，理论与案例巧妙结合，让课程更容易理解！', '1-1-9', '202002', '1', null);
INSERT INTO xedu_course.course_base (id, name, users, mt, grade, studymodel, teachmode, description, st, status, company_id, user_id) VALUES ('4028e58161bd3b380161bd3bcd2f0000', 'Redis从入门到项目实战', '', '1-3', '200002', '201001', null, 'redis在当前的大型网站和500强企业中，已被广泛应用。 redis是基于内存的key-value数据库，比传统的关系型数据库在性能方面有非常大的优势。 肖老师这套视频，精选了redis在实际项目中的十几个应用场景。通过本课程的学习，可以让学员快速掌握redis在实际项目中如何应用。 作为架构师，redis是必须要掌握的技能！', '1-3-2', '202002', '1', null);